import React, { Component } from 'react';
import './Hello.css';
import logo from './logo.svg';
import './App.css';

const Hello = (props) => {
	return (
			<div className='f1 tc'>
			  <header className="App-header">
				<h1>Hello World!!</h1>
				<p>{props.greeting}</p>
				<img src={logo} className="App-logo" alt="logo" />
				</header>
			</div>

		);
}

export default Hello;
